import React, { Component } from "react";

class PaginationTwo extends Component {
  render() {
    return (
      <div className="ui pagination menu">
        <a className="active item">1</a>
        <a className="active item" onClick={this.handleMoveLeft}>
          <span aria-hidden>&laquo;</span>
          <span>Previous</span>
        </a>
        <div className="disabled item">...</div>
        <a className="item">10</a>
        <a className="item">11</a>
        <a className="item">12</a>
      </div>
    );
  }
}

export default PaginationTwo;
